import React from "react";
import "./style.css";

export default function Roadmap() {
  return (
    <div className="roadmap" id="roadmap">
        <div  className="responsiveroad"> <img src="images/Roadmap.png" /></div>
      <img draggable="false" src="images/roadMaps.png" alt="roadmap" />
    </div>
  );
}
